//drive.google.com/file/d/1aIbBhANoJIwF2334zYdCqqV9EuuxxN5h/view?usp=sharing","name":"Calvin Wong","initials":"CW","url":"https://github.com/calvin-www","location":"Houston, TX","locationLink":"https://maps.app.goo.gl/ZTUJTxSJoDPaDR5S9","description":"A college student at Rice University who loves building anything and everything!","summary":"I\'ve always had a love for creating and improving, whether it be physical electronics or software development, designing, testing, and failing was all apart of the joy of it. After taking on a brief Sidequest into the field of Classics and winning a National Championship, I commited myself to the challenge of software development, which has been so much fun!","avatarUrl":"/me.png","skills":[{"name":"typescript","category":"language"},{"name":"javascript","category":"language"},{"name":"java","category":"language"},{"name":"python","category":"language"},{"name":"c","category":"language"},{"name":"react","category":"framework"},{"name":"next.js","category":"framework"},{"name":"node.js","category":"framework"},{"name":"ci/cd","category":"tool"},{"name":"agile","category":"tool"},{"name":"docker","category":"tool"},{"name":"aws","category":"tool"},{"name":"spark","category":"tool"},{"name":"prisma","category":"framework"},{"name":"graphql","category":"tool"},{"name":"html5","category":"language"},{"name":"css3","category":"language"},{"name":"tailwindcss","category":"framework"},{"name":"shadcn-ui","category":"framework"},{"name":"mantine","category":"framework"},{"name":"mui","category":"framework"},{"name":"nextui","category":"framework"},{"name":"amazonaws","category":"tool"},{"name":"firebase","category":"tool"},{"name":"vercel","category":"tool"},{"name":"mongodb","category":"tool"},{"name":"sql","category":"language"},{"name":"git","category":"tool"},{"name":"bash","category":"language"},{"name":"github","category":"tool"},{"name":"vscode","category":"tool"},{"name":"intellijidea","category":"tool"},{"name":"figma","category":"design"},{"name":"latex","category":"tool"},{"name":"adobe","category":"design"},{"name":"photoshop","category":"design"},{"name":"lightroom","category":"design"},{"name":"illustrator","category":"design"},{"name":"premierepro","category":"design"},{"name":"spring","category":"framework"},{"name":"maven","category":"tool"},{"name":"angular","category":"framework"},{"name":"go","category":"language"},{"name":"json","category":"language"},{"name":"apis","category":"tool"},{"name":"junit","category":"tool"},{"name":"gemini ai","category":"ai"},{"name":"cohere command r","category":"ai"},{"name":"openai","category":"ai"},{"name":"bruno","category":"tool"},{"name":"google cloud platform","category":"tool"},{"name":"heroku","category":"tool"},{"name":"machine learning","category":"ai"},{"name":"grpc","category":"tool"},{"name":"websocket","category":"tool"},{"name":"express.js","category":"framework"}],"navbar":[{"href":"/","icon":"home","label":"Home"}],"contact":{"email":"calvintwong25@gmail.com","tel":"+18329032396","social":{"GitHub":{"name":"GitHub","url":"https://github.com/calvin-www","icon":"github","navbar":true},"LinkedIn":{"name":"LinkedIn","url":"https://www.linkedin.com/in/calvin-wong-aa8874251/","icon":"linkedin","navbar":true},"X":{"name":"X","url":"https://dub.sh/dillion-twitter","icon":"x","navbar":false},"Youtube":{"name":"Youtube","url":"https://dub.sh/dillion-youtube","icon":"youtube","navbar":false},"Email":{"name":"Send Email","url":"mailto:calvinwong25@gmail.com","icon":"email","navbar":true}}},"work":[{"company":"JPMorgan Chase","href":"https://www.jpmorganchase.com","badges":[],"location":"Houston, TX","title":"Software Engineering Intern","logoUrl":"/JPMC.png","start":"Feb 2025","end":"Aug 2025","description":"As a Software Engineering Intern at JPMorgan Chase, I engineered a robust, scalable full-stack legal application for hybrid cloud deployment. Utilizing a tech stack that included Java, Spring, and SQL for the backend and Angular with TypeScript for the front-end, the application integrated over 20 microservices via RESTful APIs. This system was designed to securely manage over 43 million rows of data, and its implementation resulted in a 30x increase in the efficiency of legal investigations. Collaborating with industry mentors and traders within an Agile framework, I helped deliver more than 15 key features while ensuring the entire application complied with stringent security and legal practices."},{"company":"Fermilab","href":"https://www.dunescience.org","badges":[],"location":"Houston, TX","title":"Webpage Designer and Developer","logoUrl":"/dune.png","start":"Oct 2024","end":"May 2025","description":"At Fermilab, I worked on the DUNE (Deep Underground Neutrino Experiment) Project in association with CERN. I transformed the project\'s outdated static website into a dynamic, user-friendly platform built with Next.js, React, and a Python backend via FastAPI. This overhaul included implementing an advanced search system to efficiently manage and display millions of data files, ensuring seamless integration with an updated SQL-backed file server. I also tackled the challenges of adapting modern architecture to legacy infrastructure, managing large datasets, and improving accessibility for a global research audience."},{"company":"Headstarter","href":"https://headstarter.co","badges":[],"location":"Remote","title":"Software Engineering Fellow","logoUrl":"/headstarter.avif","start":"July 2024","end":"September 2024","description":"During my fellowship at HeadStarter AI, I built five full-stack projects, each powered by integrated AI components. Notable applications included PantryPal, a pantry management tool with voice and image-based item addition using Google\'s Gemini AI, and an AI-powered flashcard generator tailored to personalized study needs. I collaborated with industry professionals from Amazon, Bloomberg, and CapitalOne to refine my skills in design patterns, user testing, and CI/CD practices, delivering impactful AI-driven solutions."},{"company":"Owl Certamen","badges":[],"href":"https://shopify.com","location":"Remote","title":"Lead Organizer","logoUrl":"/riceshield.png","start":"July 2023","end":"January 2024","description":"As Lead Organizer for Owl Certamen, I planned and executed a statewide convention for high school and middle school students centered on Latin language and culture. I designed and built the event\'s HTML and CSS website, providing participants with a seamless online experience. Additionally, I created hundreds of academic test questions and Latin Quizbowl (Certamen) prompts, ensuring a challenging and enriching competition for attendees. This role showcased my leadership, organizational, and technical skills in a unique academic setting."},{"company":"Oculosophy","badges":[],"href":"https://shopify.com","location":"Remote","title":"Graphic Designer","logoUrl":"/oculosophy.jpg","start":"June 2020","end":"August 2020","description":"As a Graphic Design Intern at Oculosophy, I honed my skills in photo composition and DSLR operation, capturing professional-grade photos and videos. Using Adobe Suite, I edited and enhanced these visuals to create polished final products. Additionally, I designed and animated logos, videos, and promotional content, blending creativity with technical expertise to deliver visually compelling media."}],"education":[{"school":"Rice University","href":"https://rice.edu","degree":"Bachelor\'s Degree of Computer Science (BSCS) w/ Minor in Classical Civilizations","logoUrl":"/rice.png","start":"2023","end":"2027"},{"school":"Klein Collins","href":"https://kleincollins.kleinisd.net","degree":"Summa Cum Laude | Rank 9/865 | National Merit Scholarship","logoUrl":"/kleincollins.png","start":"2019","end":"2023"}],"projects":[{"title":"MockOwl","href":"","active":true,"description":"A comprehensive API mocking platform designed to simplify development and testing workflows by providing robust mock servers across multiple communication protocols. MockOwl enables developers to create dynamic, configurable mock endpoints, simulate complex network conditions, and streamline the process of building and testing distributed systems with an intuitive, developer-friendly interface.","technologies":["Next.js","React","Typescript","TailwindCSS","Mantine UI","Prisma","gRPC","WebSocket","Monaco Editor","Node.js"],"links":[{"type":"Source","href":"https://github.com/calvin-www/mock-owl","icon":"github"}],"image":"/mock-owl.png","video":""},{"title":"PantryPal","href":"","active":true,"description":"A dynamic inventory management application designed to streamline pantry organization. It offers intuitive item tracking with features like voice recognition and image capture for easy input. Users can efficiently search, sort, and view their pantry items in both card and list formats.","technologies":["Next.js","Typescript","Vercel","Mantine UI","Gemini AI","Tailwind","FireBase"],"links":[{"type":"Demo","href":"https://www.youtube.com/watch?v=yEj6bygIteI","icon":"youtube"},{"type":"Source","href":"https://github.com/calvin-www/pantrypal","icon":"github"}],"image":"/pantrypal.png","video":""},{"title":"Market Madness","href":"","active":true,"description":"Engineered a comprehensive full-stack application that simulates the dynamic world of stock trading. This immersive platform empowers users to engage in virtual stock transactions using mock currency, providing a risk-free environment to hone their investment skills. The standout feature is an integrated AI assistant that offers personalized, data-driven investment advice and walks users through sophisticated trading strategies.","technologies":["Next.js","Typescript","Next UI","Neon","Prisma","Clerk","Shadcn/ui","Gemini AI"],"links":[{"type":"Devpost","href":"https://devpost.com/software/market-madness","icon":"globe"},{"type":"Source","href":"https://github.com/moyindavid16/market-madness","icon":"github"}],"image":"/marketmadness.png","video":""},{"title":"AI Customer Service Chatbot","href":"","active":true,"description":"A modern, responsive AI customer support chat application featuring real-time conversation management, user authentication, and a sleek interface. Users can effortlessly create, select, and delete chat conversations, each with a unique interface. The AI leverages RAG to adapt and meet the user\'s needs effectively. Additionally, the app includes a feedback mechanism that stores user feedback in the database.","technologies":["Next.js","Typescript","Next UI","FireBase","Firebase Auth","AWS","Gemini AI","AI RAG"],"links":[{"type":"Demo","href":"https://www.youtube.com/watch?v=jzs-Re7X1Wo","icon":"youtube"},{"type":"Source","href":"https://github.com/calvin-www/chatapp","icon":"github"}],"image":"/chatapp.png","video":""},{"title":"Money Buddy","href":"","active":true,"description":"A friendly Discord bot that helps with personal expenses by allowing the user to upload and categorize expenses in addition to the option of uploading a receipt, which is then scanned and the text is extracted and placed into an expense category, the users expenses can then be exported as a CSV file.","technologies":["Python","JSON","Pytesseract"],"links":[{"type":"Devpost","href":"https://devpost.com/software/money-buddy-4w82v0","icon":"globe"},{"type":"Source","href":"https://github.com/calvin-www/Money-Buddy","icon":"github"}],"image":"/moneybuddy.png","video":""},{"title":"Calc Hunter","href":"","active":true,"description":"A fully functional game that uses a playful scenario about treasure hunting to teach students the importance of Calculus.","technologies":["HTML","CSS","Typescript","Prisma","Photoshop","Illustrator"],"links":[{"type":"Source","href":"https://github.com/baidenm22/KleinHacks2023EduGaming","icon":"github"}],"image":"/calchunter.png","video":""}],"hackathons":[{"title":"HackRice 14","dates":"September 20th - 23th, 2024","location":"Houston, Texas","description":"Developed a full-st